import React from "react";
import { Button, Checkbox, Dialog, DialogActions, DialogContent, DialogContentText, DialogTitle, FormControlLabel, Paper, Slide, TextField, Typography } from "@mui/material"
import style from './SolicitaServico.module.scss';
import { Box } from "@mui/system";

const Transition = React.forwardRef(function Transition(props, ref) {
    return <Slide direction="up" ref={ref} {...props} />;
});

export const SolicitaServico = ({ user, veiculo, setCadastroServico }) => {

    const [dialog, setDialog] = React.useState()

    const [open, setOpen] = React.useState(false);
    const handleClose = () => {
        setOpen(false);
    };

    const [ validaFin, setValidaFin] = React.useState({
        sim: false,
        nao: false
    })
    const restricaoFinanceira = (e) => {
        console.log(e.target.name)
        console.log(e.target.checked)
        let { nome, checked } = e.target
        if (nome === 'sim') {
            if (validaFin.sim === true) { setValidaFin(a => ({...a, sim: false, nao: false})) } else {}
        } else {

        }
    }

    


    return (
        <>
            <Dialog
                open={open}
                TransitionComponent={Transition}
                keepMounted
                onClose={handleClose}
                aria-describedby="alert-dialog-slide-description"
            >
                <DialogTitle>{dialog && dialog.titulo}</DialogTitle>
                <DialogContent>
                    <DialogContentText id="alert-dialog-slide-description">
                        {dialog && dialog.conteudo}
                    </DialogContentText>
                </DialogContent>
                <DialogActions>
                    <Button onClick={handleClose}>Fechar</Button>
                </DialogActions>
            </Dialog>
            <Typography variant='h6'>Selecione o serviço desejado</Typography>
            <div className={style.opcoes}>
                <Box sx={{ width: '100%' }}>
                    <Paper sx={{ p: 2 }}>
                        <Typography variant="h5" align="center">GRT - GUIA DE RESPONSABILIDADE TÉCNICA</Typography>
                        <div className={style.boxlinha}>
                            <h2>Despachante / Auxiliar(DAV):</h2>
                            <TextField sx={{ width: '40%' }} size="small" variant="standard" />
                            <h2>RG:</h2>
                            <TextField sx={{ width: '20%' }} size="small" variant="standard" />
                            <h2>CPF:</h2>
                            <TextField sx={{ width: '20%' }} size="small" variant="standard" />
                        </div>
                        <div className={style.boxlinha}>
                            <h2>CRDD Nº:</h2>
                            <TextField sx={{ width: '13%' }} size="small" variant="standard" />
                            <h2>,Endereço:</h2>
                            <TextField sx={{ width: '40%' }} size="small" variant="standard" />
                            <h2>Cidade:</h2>
                            <TextField sx={{ width: '32%' }} size="small" variant="standard" />
                        </div>
                        <h2 className={style.linhaservico}>Requer ao DETRAN/RS a realização dos seguintes serviços</h2>
                        <div className={style.container}>
                            <div className={style.boxleft}>
                                <h2>Haverá inclusão ou alteração de registro financeiro?</h2>
                                <div className={style.unicoassim}>
                                    <FormControlLabel control={<Checkbox checked={validaFin.sim} onChange={restricaoFinanceira} />} label='Sim' name="sim" />
                                    <FormControlLabel control={<Checkbox checked={validaFin.nao} onChange={restricaoFinanceira} defaultChecked />} label="Não" name="nao" />
                                </div>
                            </div>
                            <div className={style.boxleft}>

                            </div>
                        </div>
                    </Paper>
                </Box>
            </div>
        </>
    )
}
